import React, { Component } from "react";

export default class TimeCount extends Component {
    constructor(props) {
        super(props);

        this.state = {
            totalTime: 0

        }
    }
    addTime = (list) => {
        list.map(piece =>
            this.setState({
                totalTime: this.state.totalTime + this.props.state.totalTime
            }

            ))

    }
}
